import { SET_LOGIN_STATUS, SET_LAST_NAME } from "../types";
export const updateLoginStatus = (loginStatus) => (dispatch, getState) => {
  try {
    console.log(loginStatus, getState());
    dispatch({
      type: SET_LOGIN_STATUS,
      payload: {
        loginStatus,
        message: `Update loginStatus ${
          getState().loginReducer.loginStatus
        } to ${loginStatus} `,
      },
    });
  } catch (error) {
    console.log("Error", error);
  }
};
export const updateLastName = (lastName) => (dispatch, getState) => {
  try {
    console.log(lastName);
    dispatch({
      type: SET_LAST_NAME,
      payload: {
        lastName,
        message: `Update Lastname ${
          getState().loginReducer.lastName
        } to ${lastName} `,
      },
    });
  } catch (error) {
    console.log("Error", error);
  }
};
